import React from 'react';
import PortfolioBox from './PortfolioBox';

class Portfolio extends React.Component {
  render() {
    return (
      <div>
        <PortfolioBox></PortfolioBox>
        <PortfolioBox></PortfolioBox>
        <PortfolioBox></PortfolioBox>
        <PortfolioBox></PortfolioBox>
        <PortfolioBox></PortfolioBox>
        <PortfolioBox></PortfolioBox>
        <p>This is a portfolio desplay section</p>
      </div>
    );
  }
}

export default Portfolio;
